// each individual todo
export default function Todo({ todo }) {
  return (
    <div>
        <label>
            {/* smart way to implement a checkbox basically */}
            <input type="checkbox" checked={todo.complete} />
            hi
            {todo.name}
        </label>
    </div>
  )
}
